jQuery(document).ready(function(){var url=location.href;var paraString=url.substring(url.indexOf("?")+1,url.length).split("&");var tgVal=broker_request("tg");if(tgVal==null||tgVal==""||tgVal=="undefined"){return;}jQuery.ajax({type:"POST",url:jQuery("#broker-url").val(),data:{tg:tgVal,tuiguang:broker_request("tuiguang")}});});function broker_request(paras){var url=location.href;var paraString=url.substring(url.indexOf("?")+1,url.length).split("&");var paraObj={};for(i=0;j=paraString[i];i++){paraObj[j.substring(0,j.indexOf("=")).toLowerCase()]=j.substring(j.indexOf("=")+1,j.length);}var returnValue=paraObj[paras.toLowerCase()];if(typeof returnValue=="undefined"){return"";}else{return returnValue;}}
